    # method for generating fastest routes 
    def generateRoute(self):
        unservedDataCounter = 0
        booksQtyPerOrder = 0

        # sorting the sales orders by its book quantity limit per cart
        for unservedOrder in self.__unservedOrders:
            if booksQtyPerOrder > self.__bookQtyPerCart: 
                unservedDataCounter = unservedDataCounter + 1
                booksQtyPerOrder = 0
            else:
                self.__unservedData[unservedDataCounter].append(unservedOrder)
                
            booksQtyPerOrder = booksQtyPerOrder + unservedOrder['qty']
            
        # execute fastest route simulation process
        self.executeFastestRouteSimulation()

        # append the last order to the final sorted sales orders that is being arranged by the fastest route algorithm
        [self.__OrderQueue.append(lastOrder) for index, lastOrder in enumerate(self.__lastOrder)]

        for orderQueue in self.__OrderQueue:
            for order in orderQueue:
                self.__finalSalesOrderQueue.append(order)
        
        # return type of the generating fastest route method
        return self.__finalSalesOrderQueue

    # method for executing fastest route simulation process
    def executeFastestRouteSimulation(self):
        # getting the unserved data from the unserved data property
        for index, unservedData in enumerate(self.__unservedData):
            unservedForProcessingData = []

            # identification for arranging unserved order => line + orderQueueId + itemId + qty + soNumber + binNumber
            for unservedOrder in unservedData:
                unservedForProcessingData.append(
                    {
                        'id' : str(unservedOrder['line']) + str(unservedOrder['orderQueueId']) + str(unservedOrder['itemId']) + str(unservedOrder['qty']) + str(unservedOrder['soNumber']) + str(unservedOrder['binNumber']) + str(unservedOrder['unservedId']),
                        'binNumber' : unservedOrder['binNumber'],
                        'qty' : unservedOrder['qty'],
                        'personAcceleration' : self.__personVelocity / (2 * 1 if self.getLocations()[self.__startingPoint][unservedOrder['binNumber']] == 0 else self.getLocations()[self.__startingPoint][unservedOrder['binNumber']]),
                        'cartAcceleration' : self.__cartVelocity / (2 * 1 if self.getLocations()[self.__startingPoint][unservedOrder['binNumber']] == 0 else self.getLocations()[self.__startingPoint][unservedOrder['binNumber']])
                    }
                )
                unservedOrder['datasource'] = {
                        'id' : str(unservedOrder['line']) + str(unservedOrder['orderQueueId']) + str(unservedOrder['itemId']) + str(unservedOrder['qty']) + str(unservedOrder['soNumber']) + str(unservedOrder['binNumber']) + str(unservedOrder['unservedId']),
                        'binNumber' : unservedOrder['binNumber'],
                        'qty' : unservedOrder['qty'],
                        'personAcceleration' : self.__personVelocity / (2 * 1 if self.getLocations()[self.__startingPoint][unservedOrder['binNumber']] == 0 else self.getLocations()[self.__startingPoint][unservedOrder['binNumber']]),
                        'cartAcceleration' : self.__cartVelocity / (2 * 1 if self.getLocations()[self.__startingPoint][unservedOrder['binNumber']] == 0 else self.getLocations()[self.__startingPoint][unservedOrder['binNumber']])
                    }
                
            counterx = 0
            # getting, analyzing and processing the unserved orders data and arranged it based on the fastest route algorithm
            for data in unservedForProcessingData:
                data['booksPrevQty'] = self.__booksCurrentQty + data['qty'] 
                data['personForce'] = self.__personMass * data['personAcceleration']
                data['cartForce'] = (self.__cartMass + (self.__bookMass * data['booksPrevQty'])) * data['cartAcceleration']
                data['summationOfForce'] = data['personForce'] + data['cartForce']

                unservedData[counterx]['datasource'] = {
                    'booksPrevQty' : data['booksPrevQty'],
                    'id' : data['id'],
                    'binNumber' : data['binNumber'],
                    'qty' : data['qty'],
                    'personAcceleration' : data['personAcceleration'],
                    'cartAcceleration' : data['cartAcceleration'],
                    'personForce' : data['personForce'],
                    'cartForce' : data['cartForce'], 
                    'summationOfForce' : data['summationOfForce']
                } if data['id'] == str(unservedData[counterx]['line']) + str(unservedData[counterx]['orderQueueId']) + str(unservedData[counterx]['itemId']) + str(unservedData[counterx]['qty']) + str(unservedData[counterx]['soNumber']) + str(unservedData[counterx]['binNumber']) + str(unservedData[counterx]['unservedId']) else ""
                counterx = counterx + 1

            self.__accelerationAndForceOfSalesOrders = []

            for data in unservedForProcessingData:
                self.__accelerationAndForceOfSalesOrders.append((data['id'], data['cartAcceleration'], data['summationOfForce']))

            self.__farthestSalesOrder = min(self.__accelerationAndForceOfSalesOrders, key=lambda x: x[1])
            self.__nearestSalesOrder = max(self.__accelerationAndForceOfSalesOrders, key=lambda x: x[1])
            self.__lessFatigueSalesOrder = min(self.__accelerationAndForceOfSalesOrders, key=lambda x: x[2])
            nearestSalesOrders = heapq.nlargest(2, self.__accelerationAndForceOfSalesOrders, key=lambda x: x[1])
            
            if self.__isThisFirstProcessForUnservedData == True:
                self.__maxAccelerationMinForce = [data for data in unservedForProcessingData if self.__farthestSalesOrder[0] == data['id']][0] if self.__farthestSalesOrder[2] <= self.__lessFatigueSalesOrder[2] else [data for data in unservedForProcessingData if self.__nearestSalesOrder[0] == data['id']][0]
            else:
                for nearestSalesOrder in nearestSalesOrders:
                    self.__maxAccelerationMinForce = [data for data in unservedForProcessingData if self.__nearestSalesOrder[0] == data['id']][0] if self.__nearestSalesOrder[2] >= nearestSalesOrder[2] else [data for data in unservedForProcessingData if self.__nearestSalesOrder[0] == data['id']][0] if self.__nearestSalesOrder[2] <= nearestSalesOrder[2] else [data for data in unservedForProcessingData if nearestSalesOrder[0] == data['id']][0] 

            if self.__isTheFirstProcessDone == True:
                self.__booksCurrentQty = self.__booksCurrentQty
                self.__lastOrder[index].append([data for data in self.__unservedData[index] if self.__maxAccelerationMinForce['id'] == str(data['line']) + str(data['orderQueueId']) + str(data['itemId']) + str(data['qty']) + str(data['soNumber']) + str(data['binNumber']) + str(data['unservedId'])][0])
                self.__isTheFirstProcessDone = False
            else:
                self.__OrderQueue[index].append([data for data in self.__unservedData[index] if self.__maxAccelerationMinForce['id'] == str(data['line']) + str(data['orderQueueId']) + str(data['itemId']) + str(data['qty']) + str(data['soNumber']) + str(data['binNumber']) + str(data['unservedId'])][0])
                self.__booksCurrentQty = self.__maxAccelerationMinForce['booksPrevQty'] 

            self.__unservedData[index] = [data for data in self.__unservedData[index] if self.__maxAccelerationMinForce['id'] != str(data['line']) + str(data['orderQueueId']) + str(data['itemId']) + str(data['qty']) + str(data['soNumber']) + str(data['binNumber']) + str(data['unservedId'])]
            
            # setting the start point originator to the last max acceleration and min force data
            self.__startingPoint = self.__maxAccelerationMinForce['binNumber']


            if self.__isThisFirstProcessForUnservedData == True:
                self.__isThisFirstProcessForUnservedData = False
                self.__isTheFirstProcessDone = True

        
        if len(self.__unservedData[len(self.__unservedData)-1]) > 0:
            self.executeFastestRouteSimulation()
